INSERT INTO `or_article` VALUES ('1613218816566', '\0', '0', '', '<p>它来了它来了，博客3.0<strong>初版</strong>版本来了。目前更新的重点在于后台管理功能而且后台主题增加了win10主题</p>\n<h1 id=\"h1-u9879u76EEu4ECBu7ECD\"><a name=\"项目介绍\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>项目介绍</h1><p>小海豚博客的理念就是零配置，零安装，即部署及用 ，采用分模块的方式便于开发和维护，功能有：权限管理、人员管理，角色管理，路径资源管理，部门管理、字典管理、各种日志记录、文件管理、系统参数管理，邮件管理(支持多个邮箱账号登录，收邮件，发邮件，支持评论发送邮件，邮箱验证功能)，webSSH工具，百度站长推送，系统监控，任务调度等基础功能。博客方面有，博客编辑（支持markdown和富文本2种编辑器），类别管理，友链管理，评论管理，还增加游客浏览记录日志(用于分析，类似于百度统计),java在线运行等各种功能当然还有二次开发的功能，代码生成功能以及表单功能。<br>支持HTTPS和HTTP2种协议<br>QQ群 刚建： 321225959(已取消，等人多起来再创建群)</p>\n<h1 id=\"h1-u6280u672Fu9009u578B\"><a name=\"技术选型\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>技术选型</h1><p>后端技术：SpringBoot + Spring Data Jpa + Thymeleaf + Shiro + Jwt + EhCache +WebSocket +Jsch</p>\n<p>前端技术：Layui + Font-awesome + nkeditor +JQ</p>\n<h1 id=\"h1-u5B89u88C5u6559u7A0B\"><a name=\"安装教程\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>安装教程</h1><h2 id=\"h2-u73AFu5883u53CAu63D2u4EF6u8981u6C42\"><a name=\"环境及插件要求\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>环境及插件要求</h2><p>Jdk8+<br>Mysql5.5+<br>Maven<br>Lombok（重要）</p>\n<h2 id=\"h2-u5BFCu5165u9879u76EE\"><a name=\"导入项目\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>导入项目</h2><p>IntelliJ IDEA：Import Project -&gt; Import Project from external model -&gt; Maven<br>Eclipse：Import -&gt; Exising Mavne Project</p>\n<h2 id=\"h2-u8FD0u884Cu9879u76EE\"><a name=\"运行项目\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>运行项目</h2><p>创建一个数据库test就行，表不用创建<br>数据库配置：数据库名称test 用户xxxxx 密码xxxxx<br>通过Java应用方式运行admin模块下的com.nonelonely.BootApplication.java文件</p>\n<p>后台默认帐号密码：admin/123456</p>\n<h1 id=\"h1-u5168u65B0u7684u9879u76EEu7ED3u6784\"><a name=\"全新的项目结构\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>全新的项目结构</h1><p><img src=\"/upload/article/picture/20210213/01221ba651d343cea296cf3b8da91921.png\" alt=\"项目结构图\"></p>\n<h1 id=\"h1-u535Au5BA2u9884u89C8\"><a name=\"博客预览\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>博客预览</h1><h2 id=\"h2-pc-\"><a name=\"PC效果\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>PC效果</h2><p><img src=\"/upload/article/picture/20210213/0dff7eac7ff04bafb8d2b81694504f21.png\" alt=\"\"><br><img src=\"https://nonelonely.com/upload/images/20210213/1ba6f5e9a5c248349a6e7c7cefe28475.png\" alt=\"\"></p>\n<h2 id=\"h2-u624Bu673Au6548u679C\"><a name=\"手机效果\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>手机效果</h2><p><img src=\"/upload/article/picture/20210213/5a12657a2ed24d528a20168d68eae10e.jpg\" alt=\"\"></p>\n<h2 id=\"h2-u5728u7EBFu9884u89C8\"><a name=\"在线预览\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>在线预览</h2><p><a href=\"https://www.nonelonely.com\">前端预览</a><br><a href=\"https://www.nonelonely.com/login\">后台预览</a>  （账号/密码  test/test）</p>\n<h1 id=\"h1-u672Au6765\"><a name=\"未来\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>未来</h1><h2 id=\"h2-1-bug\"><a name=\"1.解决bug\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>1.解决bug</h2><h2 id=\"h2-2-\"><a name=\"2.重点在于编辑文章这块，接下来会增加加密文章，部分加密等功能\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>2.重点在于编辑文章这块，接下来会增加加密文章，部分加密等功能</h2><h2 id=\"h2-3-\"><a name=\"3.前端模板可以后台切换功能\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>3.前端模板可以后台切换功能</h2><h1 id=\"h1-u9047u5230u95EEu9898u53CDu9988\"><a name=\"遇到问题反馈\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>遇到问题反馈</h1><p>提问题时请优先选择Gitee Issues（方便问题追踪和一对一解决），其次我的博客-留言板。</p>\n', '/upload/article/picture/20210213/01221ba651d343cea296cf3b8da91921.png', '2021-02-13 20:20:17', null, '它来了它来了，博客3.0**初版**版本来了。目前更新的重点在于后台管理功能而且后台主题增加了win10主题\n\n# 项目介绍\n小海豚博客的理念就是零配置，零安装，即部署及用 ，采用分模块的方式便于开发和维护，功能有：权限管理、人员管理，角色管理，路径资源管理，部门管理、字典管理、各种日志记录、文件管理、系统参数管理，邮件管理(支持多个邮箱账号登录，收邮件，发邮件，支持评论发送邮件，邮箱验证功能)，webSSH工具，百度站长推送，系统监控，任务调度等基础功能。博客方面有，博客编辑（支持markdown和富文本2种编辑器），类别管理，友链管理，评论管理，还增加游客浏览记录日志(用于分析，类似于百度统计),java在线运行等各种功能当然还有二次开发的功能，代码生成功能以及表单功能。\n支持HTTPS和HTTP2种协议\nQQ群 刚建： 321225959(已取消，等人多起来再创建群)\n# 技术选型\n后端技术：SpringBoot + Spring Data Jpa + Thymeleaf + Shiro + Jwt + EhCache +WebSocket +Jsch\n\n前端技术：Layui + Font-awesome + nkeditor +JQ\n\n# 安装教程\n## 环境及插件要求\nJdk8+\nMysql5.5+\nMaven\nLombok（重要）\n## 导入项目\nIntelliJ IDEA：Import Project -> Import Project from external model -> Maven\nEclipse：Import -> Exising Mavne Project\n## 运行项目\n创建一个数据库test就行，表不用创建\n数据库配置：数据库名称test 用户xxxxx 密码xxxxx\n通过Java应用方式运行admin模块下的com.nonelonely.BootApplication.java文件\n\n后台默认帐号密码：admin/123456\n\n\n#全新的项目结构\n\n![项目结构图](/upload/article/picture/20210213/01221ba651d343cea296cf3b8da91921.png)\n\n# 博客预览\n##PC效果\n![](/upload/article/picture/20210213/0dff7eac7ff04bafb8d2b81694504f21.png)\n![](https://nonelonely.com/upload/images/20210213/1ba6f5e9a5c248349a6e7c7cefe28475.png)\n##手机效果\n![](/upload/article/picture/20210213/5a12657a2ed24d528a20168d68eae10e.jpg)\n\n##在线预览\n[前端预览](https://www.nonelonely.com)\n[后台预览](https://www.nonelonely.com/login)  （账号/密码  test/test）\n\n#未来\n## 1.解决bug\n## 2.重点在于编辑文章这块，接下来会增加加密文章，部分加密等功能\n## 3.前端模板可以后台切换功能\n\n#遇到问题反馈\n\n提问题时请优先选择Gitee Issues（方便问题追踪和一对一解决），其次我的博客-留言板。\n\n\n\n\n\n', null, '1', '它来了它来了，博客3.0初版版本来了。目前更新的重点在于后台管理功能而且后台主题增加了win10主题项目介绍小海豚博客的理念就是零配置，零安装，即部署及用，采用分模块的方式便于开发和维护，功能有：权限管理、人员管理，', '小海豚博客3.0初版来了', '', '2021-02-13 20:20:17', '', '1', '', '1', '1', '1');
